import image from '../assets/banner.png';

function header() {
  return (
    <div>
        <div style={{height: '50px', widht: 'full', backgroundColor: 'white'}}>
            <ul style={{ display: 'flex', flexDirection: 'row', listStyleType: 'none', padding: 0, justifyContent: 'end', alightItems: 'center' }}>
                <li style={{marginLeft: '25px'}}>Inicio</li>
                <li>Sobre mí</li>
                <li>Portafolio</li>
                <li>Contacto</li>
            </ul>
        </div>
        <img src={image} alt="Descripción de la imagen" />
    </div>
  );
}

export default header;
